abstract:
Le Tower Palace, ou Samsung Tower Palace est un complexe de sept gratte-ciel édifiés au début des années 2000 à Séoul en Corée du Sud. Il se subdivise en trois parties : 
* Le Tower Palace One ; 
* Le Tower Palace Two ; 
* Le Tower Palace Three.

Bankers Hall est un ensemble de gratte-ciel de bureaux de 197 mètres de hauteur construit à Calgary au Canada en 1989 et 2000. Il est composé de deux tours identiques; 
* Bankers Hall West Tower, inaugurée en 2000 
* Bankers Hall East Tower, inaugurée en 1989. Le complexe a reçu des récompenses architecturales. La surface de plancher de chaque immeuble est d'environ 76 000 m2 desservi par 16 ascenseurs. En juin 2011 c'étaient les troisièmes plus hauts immeubles de Calgary. Les immeubles ont été conçus par l'agence d'architecture The Cohos Evamy Partners

Les Miramar Towers sont un complexe immobilier construit à Panama. Il comprend trois immeubles ; 
* Les Miramar Towers, deux tours jumelles de 168 mètres de hauteur et 55 étages, construites en 1996. Elles comprennent des logements. 
* Le Miramar InterContinental, hôtel de 23 étages. L'architecte est l'agence George J. Moreno II & Associate Architects.

Western Canadian Place est un ensemble de gratte-ciel de bureaux construit à Calgary au Canada en 1983. Il est composé de deux tours; 
* Western Canadian Place North, 164 m, 41 étages, 60 715 m2 de surface de plancher 
* Western Canadian Place South, 128 m, 32 étages, 38 975 m2 de surface de plancher En juin 2011 la Western Canadian Place North était le 10° plus haut gratte-ciel de Calgary. L'immeuble a été conçu par l'agence d'architecture The Cohos Evamy Partners Le complexe a été vendu pour 230 675 000 $ en juillet 2004.

Everglades on the Bay est un ensemble de deux gratte-ciel résidentiel (condominium) construit à Miami en Floride aux États-Unis de 2005 à 2008.Il comprend deux bâtiments identiques; 
* L'Everglades on the Bay South Tower haut de 164 mètres comprenant 866 logements 
* L'Everglades on the Bay North Tower haut de 164 mètres comprenant 325 logements. L'architecte est l'agence Fullerton Diaz.

Quantum on the Bay est un ensemble de deux gratte-ciel résidentiel construit à Miami en Floride aux États-Unis de 2004 à 2008.Il comprend ; 
* Le Quantum on the Bay South Tower haut de 169 mètres et comprenant 56 étages 
* Le Quantum on the Bay North Tower haut de 163 mètres et comprenant 44 étages L'architecte est l'agence basée en Floride.

Circle on Cavill est un ensemble de gratte-ciel de logement construit dans la ville de Gold Coast dans l'état du Queensland en Australie L'ensemble est composé de deux tours; 
* Circle on Cavill North Tower, haute de 220 mètres, 70 étages, construite de 2004 à 2007 
* Circle on Cavill South Tower, haute de 158 mètres, 50 étages, construite de 2003 à 2006 La North Tower est en 2014 le troisième plus haut immeuble de Gold Coast L'architecte est l'agence Ltd.

